1	{"NAICS": [{"id": "custom-1727640829721", "value": "541611", "custom": true, "correct": false, "sentence": "This TO is to be issued off the GSA MAS 541611"}], "TITLE": [{"id": "custom-1727640901312", "value": "Performance Analysis Study for the Sexual Risk Avoidance Education (SRAE) Program", "custom": true, "correct": false, "sentence": "The purpose of this task order is to continue to conduct the SRAE Performance Analysis Study for the Sexual Risk\\nAvoidance Education (SRAE) Program, as authorized by Section 510 of the Social Security Act (42 U.S.C. 710)."}], "AGENCY": [{"id": "custom-1727640602918", "value": "Administration for Children and Families (ACF)", "custom": true, "correct": false, "sentence": "Requiring Activity:\\nU.S. Department of Health and Human Services (HHS)\\nAdministration for Children and Families (ACF)\\nOffice of Planning, Research, and Evaluation (OPRE)"}], "OFFICE": [{"id": "custom-1727640606168", "value": "Office of Planning, Research, and Evaluation (OPRE)", "custom": true, "correct": false, "sentence": "Requiring Activity:\\nU.S. Department of Health and Human Services (HHS)\\nAdministration for Children and Families (ACF)\\nOffice of Planning, Research, and Evaluation (OPRE)"}], "SET_ASIDE": [{"id": "custom-1727640764594", "value": "UNRESTRICTED", "custom": true, "correct": false, "sentence": "10. THIS ACQUISITION IS X UNRESTRICTED OR"}], "DEPARTMENT": [{"id": "custom-1727640599511", "value": "U.S. Department of Health and Human Services (HHS)", "custom": true, "correct": false, "sentence": "Requiring Activity:\\nU.S. Department of Health and Human Services (HHS)\\nAdministration for Children and Families (ACF)\\nOffice of Planning, Research, and Evaluation (OPRE)"}], "DESCRIPTION": [{"id": "custom-1727640873694", "value": "The purpose of this task order is to continue to conduct the SRAE Performance Analysis Study for the Sexual Risk Avoidance Education (SRAE) Program, as authorized by Section 510 of the Social Security Act (42 U.S.C. 710). SRAE is a federal grant program that enables States or other entities to implement education exclusively on sexual risk avoidance, meaning voluntarily refraining from sexual activity. Collection of performance measures will allow both the program office and grantees to monitor and report on progress in implementing SRAE programs.", "custom": true, "correct": false, "sentence": "The purpose of this task order is to continue to conduct the SRAE Performance Analysis Study for the Sexual Risk\\nAvoidance Education (SRAE) Program, as authorized by Section 510 of the Social Security Act (42 U.S.C. 710). SRAE\\nis a federal grant program that enables States or other entities to implement education exclusively on sexual risk\\navoidance, meaning voluntarily refraining from sexual activity. Collection of performance measures will allow both the\\nprogram office and grantees to monitor and report on progress in implementing SRAE programs."}], "FISCAL_YEAR": [{"id": "custom-1727640696418", "value": "2022", "custom": true, "correct": false, "sentence": "6. SOLICITATION ISSUE DATE 08/24/2022"}], "CONTRACT_VEHICLE": [{"id": "custom-1727640815616", "value": "GSA MAS", "custom": true, "correct": false, "sentence": "This TO is to be issued off the GSA MAS 541611"}], "SOLICITATION_NUMBER": [{"id": "custom-1727640665097", "value": "75ACF122Q00059", "custom": true, "correct": false, "sentence": "5. SOLICITATION NUMBER 75ACF122Q00059"}]}	75ACF122Q00059	2022	75ACF122Q00059 RFQ.1661352110790.pdf	914ed77b-98c7-47ff-9ce9-3668cef2bff4-@75ACF122Q00059-RFQ-1661352110790.pdf	2024-09-29 20:15:42.469994+00	2024-09-29 20:15:42.469994+00	0
