3	{"NAICS": [{"id": "NAICS-0", "value": "541611", "custom": false, "correct": true, "sentence": "541611"}], "TITLE": [{"id": "custom-1727704433626", "value": "Training and Technical Assistance (T&TA) in support of the Low-Income Home Energy Assistance Program (LIHEAP)", "custom": true, "correct": false, "sentence": "The objective of this contract is to acquire the necessary staffing resources and\\nfiscal and programmatic expertise to conduct audit and Training and Technical Assistance (T&TA) in support of\\nthe Low-Income Home Energy Assistance Program (LIHEAP) to ensure that grantees' programs are\\nimplemented in accordance with federal requirements."}], "AGENCY": [{"id": "custom-1727704484372", "value": "Administration for Children and Family (ACF)", "custom": true, "correct": false, "sentence": "The mission of the Department of Health and Human Services (HHS),\\nAdministration for Children and Family (ACF), is to foster health and well-being by\\nproviding federal leadership, partnership, and resources for the compassionate and\\neffective delivery of human services. ACF programs serve families and individuals\\nto improve their economic independence and well-being."}], "OFFICE": [{"id": "custom-1727704520565", "value": "Office of Division of Energy Assistance (DEA) ", "custom": true, "correct": false, "sentence": "To ensure the success of\\nthis mission, the ACF Office of Division of Energy Assistance (DEA) is looking to\\nprocure necessary staffing resources and fiscal and programmatic expertise to\\nconduct monitoring and to provide Training and Technical Assistance (T&TA) in\\nsupport of monitoring and enforcing those obligations."}], "SET_ASIDE": [{"id": "SET_ASIDE-0", "value": "unrestricted", "custom": false, "correct": true, "sentence": "unrestricted or"}], "DEPARTMENT": [{"id": "custom-1727704481664", "value": "Department of Health and Human Services (HHS)", "custom": true, "correct": false, "sentence": "The mission of the Department of Health and Human Services (HHS),\\nAdministration for Children and Family (ACF), is to foster health and well-being by\\nproviding federal leadership, partnership, and resources for the compassionate and\\neffective delivery of human services. ACF programs serve families and individuals\\nto improve their economic independence and well-being."}], "DESCRIPTION": [{"id": "custom-1727703988709", "value": "Successful completion of this contract shall improve the Office of Community Services’ (OCS’) administration of the LIHEAP block grant, thereby enhancing its stewardship of public funds. Outcomes include issuance by OCS of compliance review reports that shall contain, where applicable, best practices, compliance findings and recommendations to provide financial and programmatic assistance. If corrective actions are recommended, reports shall also include descriptions of such actions and justifications for decisions to disallow costs or withhold funding of existing grants in those instances where the grantee has not satisfactorily demonstrated progress in accomplishing stated goals and objectives. a. The objective of such compliance reviews shall be to: (1) Monitor and identify any programmatic and financial best practices, weaknesses, including but not limited to grants management, personnel and non-personnel expenditures, including procurement, travel, budgeting/accounting, sub grantee monitoring and property systems; (2) Review state and tribal block grant plans and all reporting requirements for conformance with the LIHEAP statute and regulations; (3) Conduct on-site compliance reviews and in-depth case file reviews in order to carry out investigations of the use of funds received by the grantees and evaluate their compliance with the provisions of the LIHEAP statute; (4) Assess the program and financial integrity of the grantee in the course of such monitoring, including software systems, internal controls, access controls, and procedures for preventing, detecting, reporting and resolving improper payments, fraud, waste, and abuse; and (5) Identify technical assistance needs of selected grantees based on findings from the reviews.", "custom": true, "correct": false, "sentence": "Successful completion of this contract shall improve the Office of Community\\nServices’ (OCS’) administration of the LIHEAP block grant, thereby enhancing its\\nstewardship of public funds. Outcomes include issuance by OCS of compliance\\nreview reports that shall contain, where applicable, best practices, compliance findings\\nand recommendations to provide financial and programmatic assistance. If corrective\\nactions are recommended, reports shall also include descriptions of such actions and\\njustifications for decisions to disallow costs or withhold funding of existing grants in\\nthose instances where the grantee has not satisfactorily demonstrated progress in\\naccomplishing stated goals and objectives.\\na. The objective of such compliance reviews shall be to:\\n(1) Monitor and identify any programmatic and financial best practices,\\nweaknesses, including but not limited to grants management, personnel\\nand non-personnel expenditures, including procurement, travel,\\nbudgeting/accounting, sub grantee monitoring and property systems;\\n(2) Review state and tribal block grant plans and all reporting requirements\\nfor conformance with the LIHEAP statute and regulations;\\n(3) Conduct on-site compliance reviews and in-depth case file reviews in order\\nto carry out investigations of the use of funds received by the grantees and\\nevaluate their compliance with the provisions of the LIHEAP statute;\\n(4) Assess the program and financial integrity of the grantee in the course of\\nsuch monitoring, including software systems, internal controls, access\\ncontrols, and procedures for preventing, detecting, reporting and resolving\\nimproper payments, fraud, waste, and abuse; and\\n(5) Identify technical assistance needs of selected grantees based on findings\\nf