4	{"NAICS": [{"id": "custom-1727704489705", "value": "54151S", "custom": true, "correct": false, "sentence": "The Peace Corps contemplates the award of a hybrid time and material (T&M) and firm-fixed price (FFP) order under the Contractor’s U.S. General Services Administration’s (GSA) Multiple Award Schedule for Information Technology – IT Services for NAICS 54151S- Information Technology Professional Services."}], "TITLE": [{"id": "custom-1727704253148", "value": "Clinical Risk Management and Quality Improvement Software Platform and License Maintenance and Support", "custom": true, "correct": false, "sentence": "Clinical Risk Management and Quality Improvement Software Platform and License\\nMaintenance and Support"}], "AGENCY": [{"id": "custom-1727704431748", "value": "Peace Corps", "custom": true, "correct": false, "sentence": "analyze and report quality improvement and risk management data for the Peace Corps Office of Health and Safety."}], "OFFICE": [{"id": "custom-1727704435454", "value": "Office of Health and Safety", "custom": true, "correct": false, "sentence": "analyze and report quality improvement and risk management data for the Peace Corps Office of Health and Safety."}], "SET_ASIDE": [], "DEPARTMENT": [], "DESCRIPTION": [{"id": "custom-1727704614347", "value": "The Peace Corps seeks a responsible Contractor to design, configure, deploy, and support e an integrated software solution – Software as a Service (SaaS) which collects, analyze and report quality improvement and risk management data for the processes outlined below. Each process shall be displayed using a dashboard format display: • Provider Credentialing o Collect o Track o Archive • Complaint and Grievance Management o Patient/Volunteer complaint or grievance • Clinical Site Assessment and Data Collection • Policy Development, editing, tracking and archiving • Patient Safety Events o Root Cause Analysis i. Root Cause & Contributory Factors ii. Auditing and Reporting iii. Visual Timeline iv