449	National Responsible Fatherhood Work Group (NRFWG)	Overall Aim. The purposes of the National Responsible Fatherhood Work Group (NRFWG) are to include the father’s voice in federal fatherhood work and in HMRF grantees’ work, and to build the fatherhood field. OFA seeks diversity and inclusion of fathers in the NRFWG. Under subcontracts, memoranda of understanding (MOUs), or another mechanism(s) between the contractor and eight (8) Responsible Fatherhood (RF) grantees, the NRFWG will offer a unique opportunity to eight (8) fathers and the eight (8) RF grantees:  \n•\tThe eight fathers will consult with OFA, their local RF programs, and RF programs across the country, so that programming is more relevant to fathers and thus more efficacious. \n•\tThe eight grantees will be able to hire these fathers as full-time FTEs for one year while only paying for part of the costs of the FTE. \n•\tThe fathers will be trained and will grow as leaders, thus building the fatherhood field. \nThe NRFWG will primarily help OFA-funded Responsible Fatherhood (RF) grant activities (both those of the eight grantees paired with the eight fathers, as well as others) with practice insights to recruit, engage, and support fathers through their programs and onwards toward self-sufficiency. Beyond the RF program, the work group will also be used to further the Administration for Children and Families’ (ACF’s) and States’ efforts to engage fathers in all services directed to families. Specifically, the work group will identify the systems with which fathers interact, such as the child support and child welfare systems or the Temporary Assistance for Needy Families (TANF) program, and offer insights on how these systems can better meet the needs of fathers and their families, and thereby improve the availability, and integration, of substantive State and local resources for fathers. In this way, the NRFWG will strengthen ACF, OFA, and HMRF-funded programs’ approaches to promoting father engagement at the program level, organization level and systems levels, federal, state, and local, to break down systemic barriers in the area of equitable access to services and encourage skill-based fatherhood programs to deliver services that resonate with fathers and are culturally responsive to the target populations served. \n	f				f	43	\N	f	f	2	52	288	\N	772	3	\N	612	2024-06-29 13:56:32.287665+00	2024-11-11 13:04:25.391519+00	0	f	\N	t	f	Civilian	HEALTH AND HUMAN SERVICES	ADMINISTRATION FOR CHILDREN AND FAMILIES		541611 Administrative Management and General Management Consulting Services	2022		GSA MAS
