818	DHS USCIS HQASN Rare Language Telephonic Services	SCOPE, General Requirements:\nTo fulfill the Asylum Division’s mission, the Contractor shall provide interpreters who can speak fluently in two or more languages and can interpreter the foreign language into English. The interpreters shall be professional and a flexible work schedule to accommodate interviews between two or more individuals that range from 30 minutes up to 4 or more hours, with the average number of hours is two to three hours.\nThe Contractor will be required to have enough trained interpreters for each language listed in the PWS to accommodate the calls volumes for the Asylum interviews. Additionally, the Contractor shall have the capacity to quickly increase staffing levels to address surges and meet time-sensitive language needs. These interviews will require the contractor to perform on-demand and over-the-phone interpretation include direct interpretation and monitoring. Many of these interviews have short schedules (10 or fewer days) to be completed in compliance with Federal laws and policies. Prescheduled interviews may be needed to accommodate interviews conducted outside normal business hours including nights, weekends, and holidays.\nMost of the work will occur between the hours of 6:00 a.m. and 6:00 p.m. Monday through Friday in the local in various time zones throughout the continental United States where the interview takes place. The Contractor is expected to provide interpretation services seven (7) days a week and, on rare occasions, twenty-four (24) hours per day within the various time zones. Weekend, holiday, and\n3\nafter-hours interpretation needs are generally at reduced volumes than during standard business hours. Notice within 48 hours (by Thursdays each week) are typical regarding weekend and holiday staffing needs, however, it cannot be guaranteed due to unexpected urgent interviews needed without advanced notice. As a deliverable, the contractor will be required to submit monthly reports of the number of interpreters available per language.\nThe contractor shall provide a range of the daily work schedules with start times and end times for the interpreters with the days of the week and time zones upon request from the COR to accommodate surges and increased schedules to include overtime for evenings (after 5pm) and weekends upon request by the USCIS Asylum Division to support increased call volumes.\nThe Contractor must have rigorous quality control processes for all language services, as discussed in Section 6.0, and will be due 15 days following the award of the contract. The quality control report must address the ability to maintain qualified interpreters to accommodate the required languages and call volumes.\nThe Contractor shall have the capability of telecommunication technology (i.e., landline and cell phone, email, fax (machine or electronic) and basic internet function) to provide services. This includes the ability to connect to multiple types of calling devices including using videoconferencing. Many of the calls will take place using Microsoft Teams. The contractor will be required to provide toll free numbers that will allow the calls to connect with minimum drop calls or other connectivity issues for MS Teams and other telephone infrastructure.\nThe contractor will be provided copies of interview forms that are used by the Asylum Officers during interviews pursuant to Section 14.0 of the PWS. The contractor might be asked to interpret or read these forms during an interview to help clarify them for the applicant. In addition, the contractor must maintain a secured folder, which should be used by the Interpreters as needed. These forms CAN NOT be stored on the Interpreter’s laptops or the computer devices. Security Violations could be issued, and the interpreter may be removed from the contract with reported incidences.	f		1629105	70SBUR22Q00000019	f	43	\N	f	f	2	53	314	886	794	4	7	612	2024-07-06 09:17:04.770565+00