400	Repository for Analytics in Virtualized Environment (RAVEN) DevSecOps	The scope of this requirement is to provide DevSecOps support to the HSI Innovation Lab by performing the following functions:\n3.1. The Government seeks to enhance the HSI DevSecOps capabilities. To this end the Government requires Contractor support services which can provide support to HSI in the advancement of its analytic platform, analytic tools, and infrastructure through collaboration with other support contractors. The contractor will be expected to leverage HSI’s analytic platform to support investigations by building and maintaining environments where modular reusable analytic processes, automated business workflows and visualizations are deployed and\nmaintaining those items after being transitioned to O&M. It is the Government’s intention to continually pursue improvements to processes and practices which will result in meeting mission requirements and provide the best value to the Government. The contractor is expected to partner with the government and other contracted support teams to further the mission of the HSI Innovation Lab.\n3.2 Provide DevSecOps support in furtherance of HSI Innovation Lab and the Repository for\nAnalytics in a Virtualized Environment (RAVEN) platform. For the purpose of this PWS the\nRAVEN environment, includes:\n• A cloud-based environment at the Law Enforcement Sensitive (LES) level, currently housed in AWS GovCloud\n• A cloud-based environment in the TS/SCI level, currently housed in AWS C2S.\n• A small cloud-based environment for the specialized collection of web-based content to support Law Enforcement outcomes, currently housed in AWS Commercial Cloud.\n• A small on-premise server environment which supports connectivity to the agency’s lawful communication interception capabilities and machine learning servers.\n3.3 Support for Development Environment/Teams: Within RAVEn development teams require regular support to configure and maintain the RAVEn non-production environments and Continuous Integration and Continuous Delivery (CI/CD) pipelines. Additionally, the team supporting the environment acts as the primary point of contact when conducting security assessments and addressing platform vulnerabilities. The Contractor shall be responsible for managing servers physical and virtual (as relevant), Kubernetes clusters, and CI/CD Pipeline infrastructure. The contractor will develop and maintain the system using Infrastructure as Code (IaC) and Configuration as Code (CaC) where automation will be leveraged for every aspect of the environment practical. The Contractor will be responsible deploying, configuring and\nhardening open source, Government Off the Self (GOTS) and Commercial Off the Self (COTS) tools, such as but not limited to Cassandra, Elastic Search, and Janus Graph, as directed by the government.\nThe contractor shall also perform the development of automated quality assurance testing. The Government intends for this team to work closely with the solution development teams, while maintaining an independent and objective position. The Government will leverage this team to ensure that only code meetings RAVEN’s high standards as identified in the Attachment 5 – RAVEN Operational Requirements is allowed to be deployed.\n3.4 Production O&M: O&M support services include modifications of Government procured software component(s) after delivery to correct faults, improve performance or other attributes; adapt to a changed environment or maintenance activities focused on anticipated problems, and preventive maintenance. These services also include providing processes, procedures, people, material, and information required to support, maintain, and operate the software aspects of a system. This includes sustaining engineering, data management, configuration management, survivability, environment, and protection of critical program information, anti-tamper provisions, information technology security, supportability and interoperability functions, and technology refresh. These services should ensure a continuously operating, reliable, stable, and secure environment.\n• The Contractor will be responsible for responding to systemic issues identified during common Tier 1, 2, and 3 escalation procedures through the ICE Remedy Service Tool. Issues are to be routinely evaluated and reviewed with the RAVEN Project Management Team to assess the appropriate prioritization for resolution of reported issues. O&M support shall consist of Tier 2 and Tier 3 support as described below. The Government will provide Tier 1 support. During this support period, the Contractor shall identify and correct software, performance, and implementation failures. Corrective work includes performing System Change Requests (SCRs) that reflect a change to requirements or technical specifications, as well as updating and maintaining the required System Lifecycle Management (SLM) documentation.	f		67317599	70CTD021Q00000139	f	43	\N	f	f	2	53	306	832	769	4	7	612	2024-06-28 15:22:12.499212+00	2024-11-10 13:19:45.139587+00	0	f	\N	t	f	Civilian	DEPARTMENT OF HOMELAND SECURITY	IMMIGRATION AND CUSTOMS ENFORCEMENT	HOMELAND SECURITY INVESTIGATIONS	541512 Computer Systems Design Services	2021	Unrestricted	GSA MAS
