500	Elk Creek Vegetation Treatment Project Cultural Resource Inventory Ashland District Custer Gallatin National Forest	Scope of Work :\nA. The Contractor shall perform an intensive (100%) pedestrian survey of identified units, employing appropriate\nsurvey methodology, and identify and evaluate all cultural resources within those units. In addition, all previously\nrecorded cultural resources will be relocated, site record updated, and evaluation made. There are 11 previously\nrecorded sites within the project area.\nB. The contractor will first conduct a site file and literature search at the Montana State Historic Preservation Office\n(SHPO) in Helena, Montana, and shall contact Zone Archaeologist Mike Bergstrom at the CGNF Billings\nSupervisor Office for additional resources. The purpose of this file search is to ensure that the contractor has\nreviewed all previous work conducted in the general area of the project and is familiar with the cultural and natural\nfeatures of the project areas. This information will be a necessary component of the inventory report.\nC. The Contractor shall employ CGNF criteria for minimum site definition; i.e. an archaeological or historical site\nconsists of any feature alone or in association with other features (cairns, stone rings) or five or more artifacts\nsituated in a discrete location within 50 meters of each other and/or artifacts or features located more than 100 meters\nfrom each other but in obvious association. Sites may also include locations which contain no physical evidence but\nare important for their association with the traditions of a group, ethnic community, or Indian Tribe; e.g., National\nRegister Bulletin 38.\nD. Formal site testing or limited shovel testing will not be conducted. If historic period architectural structures or\nremains are located the Contractor is expected to conduct a land title examination as\npart of the site identification and evaluation effort.	f		49377	1240LN22Q0055	f	43	\N	f	f	2	9	