ealistic and reasonable for this effort. Offerors are directed to pay close attention to Section L – Instructions to Offerors and Section M –Evaluation Factors for Award. Please also pay careful attention to, and complete Section K – Representations, Certifications and Other Statements. All submitted proposals must be signed by an authorized official with the authority to bind the firm represented by the Offeror.\n\nQuestions and comments related to this RFP must be submitted electronically to cghimire@usaid.gov, with a copy to me at mtelevantos@usaid.gov by the deadline stated. Answers to questions received in writing will be made available to all offerors through an amendment to the RFP and posted on www.sam.gov.\n\nIt is extremely important that electronic submissions be made by the date and time indicated above. Proposals received after the closing date and time will be processed as late and handled in accordance with FAR 15.208. Pursuant to Block 12 of Standard Form 33 of this RFP, offers must remain valid for 268 days. Please ensure that your company’s registration in the System for Award Management (SAM) is current and up to date. SAM can be accessed at www.sam.gov. Electronic submissions must be sent to cghimire@usaid.gov with a copy to me at mtelevantos@usaid.gov. No other form of submission will be accepted.\n\nPre-Proposal Conference: A pre-proposal conference will be held virtually on June 12, 2024. The purpose of the Pre-Proposal Conference is to ensure an understanding of the RFP’s technical objectives and to review the proposal process. The Conference agenda will include a short presentation of the RFP and a question/answer session based on participants’ review of the RFP. \n\nAll interested potential Offerors are welcome to attend, but it will be limited to 2 representatives per Offeror and all attendees must register. If you are interested in attending the Pre-Proposal Conference, please send an email to Chetana Ghimire at cghimire@usaid.gov with a copy to Maria Televantos at mtelevantos@usaid.gov by the deadline stated above. Include the name of your organization and the name(s) of the person(s) who will attend. USAID will respond with an email confirming registration, a google meet link will be shared with the registered offerors along with a confirmed time of the meeting. You must have a registration in order to receive a meeting link for the pre-proposal conference. An amendment to the solicitation will be posted shortly after the conference containing the presentation and questions and answers covered during the conference.\n\nIssuance of this RFP in no way obligates the U.S. Government to award a contract nor does it commit the U.S. Government to pay any costs incurred in the preparation and submission of a proposal. Award of a contract under this RFP is subject to availability of funds and other internal USAID approvals. This RFP can be viewed and downloaded from www.sam.gov. USAID bears no responsibility for data errors resulting from transmission or conversion processes. Further, be aware that amendments to solicitations are occasionally issued and will be posted on the same website from which you downloaded the solicitation. USAID advises to regularly check the above website for amendments.	f			72036724R00005	f	46	\N	f	f	2	8	152	1720	772	1	\N	\N	2024-07-17 01:40:30.830874+00	2024-07-19 01:04:27.984062+00	0	f	\N	f	f	Civilian	AGENCY FOR INTERNATIONAL DEVELOPMENT	BUREAU FOR ASIA	PMA 266 MULTI-MISSION TACTICAL UAS PROGRAM	541611 Administrative Management and General Management Consulting Services	2024	\N	\N
