836	Microsoft engineering and consulting services	SCOPE OF WORK:\nCDC requires contractors who are authorized resellers of Microsoft Consulting Services (MCS) and Microsoft Premier Support Services (MS-PSS). This includes “Microsoft Partners” (specifically companies with a current Microsoft Master Services Agreement with Microsoft Corporation and those that maintain competency standards set and validated by Microsoft Corporation). This will provide CDC the technical proficiency covering the totality of CDC Microsoft IT technologies for advice and consultation to its internal process owners, customers and stakeholders to ensure that CDC IT architectural plans, IT projects, solutions, and strategic initiatives are fully leveraged, for the present and the future.\n3.1 The Contractor shall provide a web based portal for the CDC to open tickets and track status.\n3.2 \tThe Contractor shall provide monthly and an annual report of what has been purchased against this BPA.\n3.3 \tCDC requires Microsoft Consulting Services (MCS) and Premier support of Microsoft products including but not limited to:\na.  Microsoft Active Directory (to include Active Directory Federated Services (ADFS)) – A central component of the Windows platform, Active Directory service provides the means to manage the identities and relationships that make up network environments. Active Directory Services make this task simpler to manage, easing migration, and deployment. ADFS simplifies access to systems and applications using a claims-based access (CBA) authorization mechanism to maintain application security. ADFS supports two-factor authentication as well as single-sign-on (SSO) technologies that help information technology (IT) organizations collaborate across organizational boundaries;\nb. Microsoft Exchange – A messaging and collaboration server that enables CDC to send and receive electronic mail and other forms of interactive communication through computer networks. Designed to interoperate with a software client application such as Microsoft Outlook, Exchange Server also interoperates with SharePoint and other e-mail client applications;\nc. Microsoft Project and Project Server – Generating business value through strategic alignment, Microsoft Office Enterprise Project Management (EPM) software enables organizations to align work with business priorities, automate project management activities, and accelerate business success. EPM facilitates the implementation of an EVM system;\nd.  Microsoft IIS – IIS is a web server technology included with Windows Server to host web-based applications and web services. It plays a central role in unifying Microsoft web platform technologies, including ASP.NET, Windows Communication Foundation web services, and Windows SharePoint Services;\ne. Microsoft .NET – .NET is the Microsoft web services (horizontal development) and application (vertical development) strategy to connect information, people, systems, and devices through software. Integrated across the Microsoft platform, .NET technology provides the ability to quickly build, deploy, manage, and use connected, security-enhanced solutions. . NET-connected solutions enable organizations to integrate their systems more rapidly and in a more agile manner;\nf. Microsoft SharePoint – SharePoint enables a single point of access to multiple systems such as Microsoft Office System programs, business intelligence and project management systems, and existing LOB applications, including third-party and industry-specific programs. SharePoint includes search technology allowing CDC to search file shares, web servers, Microsoft Exchange Server public folders, and Windows SharePoint Services sites;\ng. Microsoft Lync - delivers instant messaging (IM) and presence as part of a scalable, enterprise-grade solution offering enhanced security, seamless integration with other Microsoft products, and an extensible development platform;\nh. Microsoft Live Meeting - Live Meeting (audio and video conferencing service) gives CDC the ability to bring together colleagues and partners remotely for online meetings, training, and events;\ni. Microsoft Windows Server Operating System – Windows Server operating system, providing a more efficient way to manage and control access to local and remote resources. Windows Server provides a scalable, security-enhanced Web platform, interoperability with UNIX-based systems and enables new scenarios including simplified branch server management, improved identity and access management, and more efficient storage management. It includes additional features such as Digital Rights Management, Direct Access, Network Access Protection, and ISA capabilities CDC requires;\nj. Microsoft Windows Desktop Operating System - Windows graphical interface allowing users to run desktop applications, including Microsoft Office and web browsers;\nk. Microsoft Office – Microsoft Office includes programs and services designed to work together to help address a broad array of business problems. Microsoft Office solutions include, but aren’t limited to, the following: Access, Communicator, Excel, FrontPage, InfoPath, Office Live, OneNote, Outlook, PowerPoint, Project, Publisher, Visio, and Word;\nl. Microsoft System Center - System Center solutions help systems administrators manage physical and virtual infrastructure across data centers, client computers, and devices. System Center allows CDC to build workflows to monitor, patch, and manage its Windows servers;\nm. Microsoft SQL Server – SQL Server is Microsoft’s primary relational database management system and\nincludes integrated reporting and analytic modules to analyze and format data for end user\nconsumption. SQL Server holds user defined databases as well as database structures and data\nsupporting other Microsoft platforms, including Lync, SharePoint, and Exchange.	f			75D30121R71937	f	43	\N	f	f	2	52	291	2319	769	4	6	612	2024-07-06 10:25:21.952391+00	2024-11-11 19:05:05.725992+0