866	CYBERSPACE OPERATIONS FORCES AND SUPPORT (COF)	Scope:\nThe scope of the Cyberspace Operational Forces (COF) requirement is to provide cybersecurity defense for the USTRANSCOM enterprise. This will be Security Operations Management/Cybersecurity Service Provider (CSSP) services for on premises and in cloud environments. The major associated activities that the contractor shall perform cybersecurity boundary defense; infrastructure support; intrusion detection monitoring and incident management; cyber threat analysis; security solution administration; detection and analysis; cybersecurity forensic analysis; data scientist for zero trust, policy analytics, Splunk, and continuous improvement and optimization.\n5\nThe Cyberspace Operational Forces (COF) contract is responsible for protecting against, defending, and responding to suspicious or malicious cyber activity across the USTRANSCOM enterprise. The contractor shall utilize managed services best practices to perform the tasks and subtasks of this Performance Work Statement (PWS) to provide responsive IT service delivery. The required outcomes are delivering COF services to USTRANSCOM users within agreed service levels and achieving continual cybersecurity improvements to the COF services. The contractor shall be responsible for coordinating, managing, assigning resources, processes, and activities to achieve the successful delivery of the entire cybersecurity service delivery process as defined in this PWS. The contactor, in concert with the Government, will establish, collect, and report metrics to evaluate and improve service delivery performance.\nThis contract will also cover and support execution of USTRANSCOM's CSSP mission, defensive cyberspace operations (DCO), coordination of Cyberspace Protection Team (CPT) missions and requirements, DCO and joint planning to include development of Concepts of Operations (CONOPs) and Operational Plans (OPLANs), joint training and readiness management, spectrum management, Satellite Communications (SATCOM) mission planning, survivable SATCOM operations, senior leader airborne communications support, and tactical communications projects. The contract will require 24/7 on-site support for some COF activities.	f		35212301	HTC71122QD003	f	43	\N	f	f	1	3	106	287	771	3	6	612	2024-07-06 14:32:35.058975+00	2024-11-11 19:06:38.982061+00	0	f	\N	f	f	Defense	DEPARTMENT OF DEFENSE	US TRANSPORTATION COMMAND	DIRECTORATE OF ACQUISITION (TCAQ)	541519 Other Computer Related Services	2022	Small Business Set-Aside - Total	GSA MAS
848	Analyze, Design, Develop, Implement and Evaluate (ADDIE) eLearning Course Production	Scope of Work:  \nThe Contractor shall provide all labor, supervision, and other resources required to produce web-based training content conformant with SCORM 1.2 or SCORM 2004 4th Edition specifications and compliant with VA Section 508 standards and accessed on the VA TMS/VHA TRAIN as specified at the Task Order level.\nThe scope of this project supports VA clinical and non-clinical career fields, including accredited courses for most health care professions including those for medical, nursing, pharmacy, social work, physician’s assistants, psychology, and psychiatry. If a course is distributed on VHA TRAIN, it is available to the same professions outside VA. Accredited courses must conduct a pilot for accreditation purposes.\n\nThe contractor shall incorporate the ADDIE approach to instructional design, incorporating industry standards and best practices within the contractors Standard Operating Procedures to produce effective Web-Based Training. Learning products shall be hosted on and managed by the VA’s TMS/VHA TRAIN and/or another SCORM conformant Learning Management System (LMS) and shall be fully functional on the LMS platform. The courseware must conform to SCORM 1.2, and/or SCORM 2004 4th Edition and be fully functional on VA TMS, VHA TRAIN, and any other VA LMS or VA technology systems as specified at the Task Order Level. If it is determined that the learning product will be placed on VHA TRAIN, it must only utilize SCORM 1.2 with special care given not to exceed 4096 characters in suspend data. This factor will affect the design and development of the learning product. The complexity (structure and volume) of the learning product may dictate that multiple Shared Content Objects (SCOs) are needed.\nSome content may be presented over other VA networks or LMS which will be specified at the task order level. The developed content shall be in a common format that is transmittable and viewable on current VA network technology systems and compatible with all modern web browsers. The VA currently uses Microsoft Edge as its default browser.\n\nAll learning products shall be designed and built to meet Web Content Accessibility Guidelines (WCAG) 2.0 AA compliance standards for accessibility. All learning products must be thoroughly tested and certified either by the VA Section 508 Office or self-certified by a Department of Homeland Security (DHS) Certified Trusted Tester and submitted to the VA Section 508 Office following their processes and procedures for self-certification confirmation and record keeping.\n\nAny Task/CLIN within any phase of the ADDIE model may be ordered separately from the base contract as needed by the government and will be specifically delineated at the task order level. This may involve production of new courseware or updates to existing courseware. Existing courseware may be VA owned and developed, created by outside sources, or Commercial Off-The-Shelf (COTS) training that will be customized specifically to meet VA specific needs.\nTraining shall be produced as asynchronous e-Learning courses and media-based materials and shall be designed to be available within the VA network and across external facing networks. Training projects will range between the interaction/complexity Levels 1, 2 and 3 as defined in the glossary. This contract will include primarily web-based training as eLearning content, viewable on a mobile device or computer and specified at the Task Order level. All products and materials shall be designed and tested to ensure seamless access and conformance with all VA policies and directives.	f				f	43	\N	f	f	2	112	593	\N	849	3	\N	612	2024-07-06 12:30:54.195266+00	2024-11-11 12:28:47.539733+00	0	f	\N	t	f	Civilian	DEPARTMENT OF VETERANS AFFAIRS	VETERANS HEALTH ADMINISTRATION		611430 Professional and Management Development Training	2022		GSA MAS
