714	 FINANCIAL AUDIT SERVICES  FOR OFFICE OF INSPECTOR GENERAL (OIG)	Scope:\nThe Chief Financial Officers Act of 1990, as amended by the Government Management Reform Act of 1994, requires the preparation of an annual audited financial statement covering all accounts and activities of each office, bureau, and activity of the Department. The audits shall be performed in accordance with generally accepted government auditing standards (GAGAS), as specified in the current version of the Government Accountability Office’s (GAO’s) Government Auditing Standards, and additional federal audit requirements prescribed by the Office of Management and Budget (OMB). The following applies to both Tasks 1 and 2):\na. The scope of the DOC consolidated financial statement audit shall include all bureaus, funds, programs, activities, and offices within the DOC. Thus, the results of the USPTO stand-alone audit shall be incorporated into the DOC consolidated financial statement audit report. The contractor shall also issue an audit report for the separate stand-alone audit of USPTO’s financial statements.\nb. The audits shall determine whether the financial statements have been prepared in conformity with generally accepted accounting principles. The contractor shall perform audit procedures to evaluate the design and effectiveness of the Department’s internal control relevant to the financial reporting. In addition, the contractor shall also perform audit work necessary to determine compliance with provisions of applicable laws, regulations, contracts, and grant agreements that have a direct effect on the financial statements, including determination of the DOC’s compliance with Federal Financial Management Improvement Act. Further, the contractor work shall consider that DOC relies on other federal agencies for processing a portion of its financial information.\nc. The audit methodology used shall, at a minimum, be consistent with the most current version of the GAO’s Financial Audit Manual (FAM). This methodology may be supplemented by the contractor’s audit methodology; however, any methodology other than the FAM must meet or exceed the requirements of the FAM. In cases where the contractor’s methodology differs from the FAM, the contractor must provide documentation to the contracting officer’s representative (COR) on a timely basis, demonstrating how the contractor’s methodology satisfies the requirements of the FAM. The contractor shall provide written request for approval to the COR for any significant deviations from the FAM.\nd. The contractor shall perform testing of general information technology (IT) controls, which shall include all IT financial processing environments and facilities at the DOC that support financial reporting. The work shall be consistent with the guidelines outlined in GAO’s Federal Information System Controls Audit Manual (FISCAM) which describes five major categories of general controls: 1) security management; 2) access controls; 3) configuration management; 4) segregation of duties; and 5) contingency planning. General controls audit work shall address each of these five areas. The contractor shall notify the COR if the review of some categories be emphasized over others, and provide appropriate and adequate written justification to the COR.\ne. The contractor shall also perform application controls review related to the specific financial statement program applications deployed by DOC to support financial statement reporting.\nf. The following DOC data center facilities are included in the scope of the IT work, including:\n. NOAA Data Centers in Landover, Maryland and Germantown, Maryland\n. NIST Data Center in Gaithersburg, Maryland\n. CBS Solutions Center facility in Gaithersburg, Maryland\n. NTIS Data Center in Alexandria, Virginia\n. Census Data Centers in Bowie, Maryland (primary) and Suitland, Maryland (secondary)USPTO Data Center in Alexandria, Virginia (primary), and Manassas, Virginia (secondary)\ng. When a specific general IT control area/environment is identified as ineffective, the specific controls pertaining to its ineffectiveness will not be reviewed. For such IT areas/environment, the scope of work will pertain to follow up of prior year audit findings.	f			GG0000002200045	f	43	\N	f	f	2	17	204	562	772	3	6	612	2024-07-05 07:30:27.323968+00	2024-11-12 23:16:19.854611+00	0	f	\N	f	f	Civilian	DEPARTMENT OF COMMERCE	INSPECTOR GENERAL	CHIEF FINANCIAL OFFICER	541611 Administrative Management and General Management Consulting Services	2022	Small Business Set-Aside - Total	GSA MAS
