rksheets shall be included in the final report as appendices.	f		20896	12444522Q0037	f	43	\N	f	f	2	9	181	\N	777	3	6	612	2024-07-05 07:47:41.132183+00	2024-11-12 23:16:58.495962+00	0	f	\N	f	f	Civilian	AGRICULTURE	FOREST SERVICE		541620 Environmental Consulting Services	2022	Small Business Set-Aside - Total	GSA MAS
