gree or a combination of education in physical science, engineering or math, and have experience in accordance with the OPM qualification standards listed in the vacancy announcement at the time of posting and will be outlined in detail and listed on the USAJobs website.\n\nThe anticipated SES vacancies all require that the potential applicants be evaluated to determine the degree to which they possess the ECQs and the Professional Technical Qualifications (PTQs) such as in the sample statement listed below for many of the NESDIS SES director level STEM positions:\nA. PTQ 1 -Broad knowledge and extensive experience in the physical sciences, engineering or mathematics, as related to state-of-the-art system development of Earth Remote-sensing satellite development and system acquisition programs.\nB. PTQ 2 - Demonstrated leadership and management ability in planning and directing major system acquisition programs. This included the ability to recruit, motivate and develop a strong and diverse management team and workforce, communicate well with individuals at all levels of responsibility, and achieve results through others.\nC. PTQ 3 - Knowledge and experience in the area of applications of satellite data and services for end-user purposes.	f			1333MD22BNEEA0002	f	43	\N	f	f	2	17	208	569	803	4	6	612	2024-07-04 06:54:18.68696+00	2024-11-12 11:22:39.946646+00	0	f	\N	f	f	Civilian	DEPARTMENT OF COMMERCE	NATIONAL OCEANIC AND ATMOSPHERIC ADMINISTRATION	NATIONAL ENVIRONMENTAL SATELLITE DATA AND INFORMATION SERVICE	561312 Executive Search Services	2021	Small Business Set-Aside - Total	GSA MAS
