698	ECX Service Catalog / Portal	Business demand is pushing Space Systems Command/Cross-Mission Ground Communications (SSC/ECX) to create and operate an ECX service catalog portal and a customer relationship management for managing its customers. ECX is pursuing the acquisition of ECX Service Catalog / Portal from commercial provider of Service Catalog / customer relationship management (CRM) services and software. The intent is to bring together a federation of services into a single web-based store front that provides a highly innovative, creative, cost-effective, and evolving environment. The ideal solution would be an integrated tool set through which the government monitors performance metrics and that allows the government to manage through roles and business rules rather than physical control of assets and direct software licensing. The government believes that traditional outsourcing, system integration, and maintenance support is insufficiently adaptive and costly and should be replaced by commercial-off-the-shelf (COTS) service catalog / CRM offering.\nThis Statement of Objectives (SOO) describes the goals that ECX expects to achieve regarding the\n1. Modernization of its service catalog / CRM;\n2. Provision of an effective service catalog / CRM working environment;\n3. Reduction of the government’s sustainment costs by providing related business, technical, and management functions; and\n4. Application of appropriate security and privacy safeguards\nOur approach to the implementation is a crawl, walk, run methodology using minimal viable products (MVPs) in a phased fashion. The crawl MVP phase describes the enterprise and its service offerings utilizing a service catalog. The MVP walk phase introduces the on boarding of mission partners and CRM tracking of their needs. The MVP run phase includes the crawl and walk phases and introduces dashboards, metrics tracking, and management of the services.\nUltimately, the service catalog / CRM tool solution will meet industry performance standards, be based on industry best practices and standards outlined in the ITSM strategy ISO/IEC 2000-1 (2018), ITIL v4 standards and other relevant commercial guidance. These practices, standards,\nprocesses, and procedures align IT services to business needs. The solution will offer the necessary redundancy and contingency features to meet ECX needs and provide state-of-the-art technology enhancements to improve user experience and minimize service disruption. ECX is partnering with GSA to conduct market research to evaluate the viability and cost of various\noptions, and possibly an acquisition after receipt of the market research performed.	f				f	43	\N	f	f	1	1	38	58	769	4	\N	612	2024-07-05 02:50:01.744695+00	2024-11-13 00:21:22.440784+00	0	f	\N	t	f	Defense	UNITED STATES AIR FORCE	US SPACE FORCE	SPACE SYSTEMS COMMAND	541512 Computer Systems Design Services	2021		GSA MAS
