nd innovative business process solutions utilizing the Oracle eBusiness suite and related software tools to address Air Force accounting and reporting needs.\n Recommend remediation plans for financial audit findings utilizing the existing DEAMS and available Oracle software solutions. \n Research, analyze, and provide technical and functional system specific data to support the FMO with requests for information from external stakeholders\n Coordinate with the government points of contact to complete pre- deployment checklists and arrange all logistical support.	f				f	43	\N	f	f	1	1	\N	\N	772	4	\N	612	2024-07-05 16:33:01.989375+00	2024-11-10 13:27:03.402771+00	0	f	\N	t	f	Defense	UNITED STATES AIR FORCE			541611 Administrative Management and General Management Consulting Services	2021		GSA MAS
