 to submit monthly reports of the number of interpreters available per language.\nThe contractor shall provide a range of the daily work schedules with start times and end times for the interpreters with the days of the week and time zones upon request from the COR to accommodate surges and increased schedules to include overtime for evenings (after 5pm) and weekends upon request by the USCIS Asylum Division to support increased call volumes.\nThe Contractor must have rigorous quality control processes for all language services, as discussed in Section 6.0, and will be due 15 days following the award of the contract. The quality control report must address the ability to maintain qualified interpreters to accommodate the required languages and call volumes.\nThe Contractor shall have the capability of telecommunication technology (i.e., landline and cell phone, email, fax (machine or electronic) and basic internet function) to provide services. This includes the ability to connect to multiple types of calling devices including using videoconferencing. Many of the calls will take place using Microsoft Teams. The contractor will be required to provide toll free numbers that will allow the calls to connect with minimum drop calls or other connectivity issues for MS Teams and other telephone infrastructure.\nThe contractor will be provided copies of interview forms that are used by the Asylum Officers during interviews pursuant to Section 14.0 of the PWS. The contractor might be asked to interpret or read these forms during an interview to help clarify them for the applicant. In addition, the contractor must maintain a secured folder, which should be used by the Interpreters as needed. These forms CAN NOT be stored on the Interpreter’s laptops or the computer devices. Security Violations could be issued, and the interpreter may be removed from the contract with reported incidences.	f		1629105	70SBUR22Q00000019	f	43	\N	f	f	f	2	53	314	886	794	4	7	612	2024-07-06 09:17:04.7