848	Analyze, Design, Develop, Implement and Evaluate (ADDIE) eLearning Course Production	Scope of Work:  \nThe Contractor shall provide all labor, supervision, and other resources required to produce web-based training content conformant with SCORM 1.2 or SCORM 2004 4th Edition specifications and compliant with VA Section 508 standards and accessed on the VA TMS/VHA TRAIN as specified at the Task Order level.\nThe scope of this project supports VA clinical and non-clinical career fields, including accredited courses for most health care professions including those for medical, nursing, pharmacy, social work, physician’s assistants, psychology, and psychiatry. If a course is distributed on VHA TRAIN, it is available to the same professions outside VA. Accredited courses must conduct a pilot for accreditation purposes.\n\nThe contractor shall incorporate the ADDIE approach to instructional design, incorporating industry standards and best practices within the contractors Standard Operating Procedures to produce effective Web-Based Training. Learning products shall be hosted on and managed by the VA’s TMS/VHA TRAIN and/or another SCORM conformant Learning Management System (LMS) and shall be fully functional on the LMS platform. The courseware must conform to SCORM 1.2, and/or SCORM 2004 4th Edition and be fully functional on VA TMS, VHA TRAIN, and any other VA LMS or VA technology systems as specified at the Task Order Level. If it is determined that the learning product will be placed on VHA TRAIN, it must only utilize SCORM 1.2 with special care given not to exceed 4096 characters in suspend data. This factor will affect the design and development of the learning product. The complexity (structure and volume) of the learning product may dictate that multiple Shared Content Objects (SCOs) are needed.\nSome content may be presented over other VA networks or LMS which will be specified at the task order level. The developed content shall be in a common format that is transmittable and viewable on current VA network technology systems and compatible with all modern web browsers. The VA currently uses Microsoft Edge as its default browser.\n\nAll learning products shall be designed and built to meet Web Content Accessibility Guidelines (WCAG) 2.0 AA compliance standards for accessibility. All learning products must be thoroughly tested and certified either by the VA Section 508 Office or self-certified by a Department of Homeland Security (DHS) Certified Trusted Tester and submitted to the VA Section 508 Office following their processes and procedures for self-certification confirmation and record keeping.\n\nAny Task/CLIN within any phase of the ADDIE model may be ordered separately from the base contract as needed by the government and will be specifically delineated at the task order level. This may involve production of new courseware or updates to existing courseware. Existing courseware may be VA owned and developed, created by outside sources, or Commercial Off-The-Shelf (COTS) training that will be customized specifically to meet VA specific needs.\nTraining shall be produced as asynchronous e-Learning courses and media-based materials and shall be designed to be available within the VA network and across external facing networks. Training projects will range between the interaction/complexity Levels 1, 2 and 3 as defined in the glossary. This contract will include primarily web-based training as eLearning content, viewable on a mobile device or computer and specified at the Task Order level. All products and materials shall be designed and tested to ensure seamless access and conformance with all VA policies and directives.	f				f	43	\N	f	f	f	2	112	593	\N	849	3	\N	612	2024-07-06 12:30:54.195266+00	2024-07-17 10:31:40.380539+00	0	f	67	t	\N	\N	\N	\N	\N	\N	\N	\N	\N
676	Supply Chain Risk Assessment Software	Objectives:\n1. For any supply chain/market/industrial base or critical infrastructure sectors assigned for risk assessment, the contractor shall identify and deliver to the Government all data deemed relevant to the government such as capabilities in addition to conducting risk analysis on supply chains, third-party vendors, ultimate beneficial ownership, financial and operational health within 0 to 28 business days from assignment.\n2. The contractor shall be capable of conducting program/product/component/technology sector/critical infrastructure sector risk assessments. Unless otherwise specified or instructed, each directed assessment, depending on complexity and scale, shall be completed and available via a transferrable format (memorandum, presentation, etc.), and via a software-enabled format (a web-accessible dashboard with the ability to drill down to individual entity data) within 0 to 21 business days from assignment.\n3. The contractor shall assemble publicly available data on company financials, board governance, demographics (employees, locations, leadership), cyber hygiene, and all data pertaining to foreign ownership, control, and influence.\n4. The contractor shall be able to classify both public and private companies according to multiple industry classifications including, but not limited to, PSC, GICS, SIC, and NAICS codes using software and analytics. The contractor shall seamlessly integrate data on private sector operations with known federal government contracting performance.\n5. The contractor shall provide a structured dataset for additional processing and risk analysis with standardized indicators and metrics for material and derogatory information.\n6. The contractor shall have demonstrated knowledge across, or the ability to interpret, a diverse set of technologies across the following industries: Pharmaceuticals, Aerospace & Defense, Electrical Equipment, Semiconductors, Biotechnology, Life Sciences Tools & Services, Communications Equipment, and Electronic Equipment, Instruments & Components.\n7. The contractor shall provide persistent updates and monitoring of supply chain/market/industrial base risk assessments as needed; specifically, the ability to monitor unstructured open web content, as far back in time aspossible.8. The contractor shall leverage best-in-class commercial data tools and applications such as cloud-based tools, data visualization, NLP / Neural Networks, and open source development tools such as R and Python. The contractor shall perform operations and maintenance support, providing all necessary activities to sustain a cloud environment for the data pipeline, master dataset, and analytic application, including, but not limited to the operations in this section.\n9. The contractor shall be able to access premium commercial data sets to include but not limited to News Media, Public Company Data, Private Company Data, Patents, Social Media, and the ability to add other data sets as required.\n10. The contractor shall leverage technical capability that integrates international open source data as far back in time as possible, leveraging AI/ML to perform entity resolution and risk analysis, translating foreign data sources to English, and delivering content in a consumable fashion for supply chain risk assessment.\n11. The contractor shall be able to provide concise summaries and visualizations of data to enable decision making via dynamic dashboards and reports.\n12. The contractor shall have experience working with unstructured data and conducting market analysis for commercial (Fortune 1000) firms.\n13. The contractor shall prove that a commercial solution has been successfully adapted to a Department of Defense requirement or program with respect to supply chain risk assessment and market intelligence.\n14. The contractor shall provide access to a web-based data analytics platform for the performance of due diligence analysis, risk identification and reporting, and continuous monitoring.\n15. The contractor shall train DoD personnel and the contract shall immediately begin utilizing the platform to conduct due diligence reviews on entities identified by the Department of Defense and notify the department of all relevant industrial health risk indicators outlined below. (environmental/climate change, financial, foreign influence, human capital, product quality/design, political and regulatory, compliance, manufacturing and supply, transportation and distribution, technology, and cybersecurity with an ability to expand as other health risk indicators are prioritized).\n16. The contractor shall provide tiered levels of assessments from initial risk assessments to detailed project analyses priced accordingly.\n17. The contractor shall ensure the platform is able to perform batch uploading of companies, cage codes, NIINs, etc. and associated personnel/suppliers being screened and vetted for the government.\n18. The platform must be able to identify companies with any foreign ownership, control, and influence (FOCI) concerns to include adversarial finance risk indicators, and be able to vet and continuously monitor foreign personnel to identify potential FOCI risk.\n19. The platform subscription must include an unlimited number of users for subscribing entity or organization.\n20. The platform must be able to automatically flag and compile in one report industrial health risk and derogatory issues on companies to include, but not limited to, criminal proceedings, civil offenses, reputation / brand issues.\n21. The contractor shall provide market intelligence and vendor risk assessment products that summarize and visualize results of due diligence analysis.\n22. The contractor shall provide training as needed for any aspect of the platform as required by this contract.23. The contractor shall provide a Software as a Service (SaaS) or licensing agreement providing accessibility for the term of 12 months. Access to the contractor’s risk assessment capabilities must occur within 15 days of contract award. This will include access to data on any corporate entities owned by DOD.\n24. The platform shall have the ability to continuously monitor companies and associated entities and people for industrial health risk or derogatory flags impacting trustworthiness and eligibility for continued access to government information on up to a daily basis.\n25. The platform shall provide out-of-the-box configurable artificial intelligence (AI), Machine Learning (ML) and Natural Language Processing (NLP) models that can be configured rapidly to the evolving needs of the government under this authority.\n26. The platform shall ensure the highest level of ethics and transparency in how reports are generated. Must have out-of-the-box capabilities to document the AI decision making logic and the data lineage to support humanmachine integration, auditing, and to support and defend agency decisions.\n27. The platform shall provide a breadth of data sources that are readily available and with a global reach, including commercial, open web (as far back in time as possible, both foreign and domestic), open government (global), global watch list, non-traditional data sources, while obfuscating/anonymizing search and aggregation techniques.\n28. The contractor shall conduct cyber hardening of their commercial infrastructure to ensure resilience against adversarial cyber-attacks within six months of contract award.\n29. The platform shall perform automated language translation in the search process to enable identification of potential foreign risk indicators including foreign ownership, control, and influence.\n30. The contractor shall provide a dedicated Program Manager, Technical Lead, and trained analysts to provide project management support for the duration of the program.\n31. The contractor shall provide TS/SCI eligible deployment specialists to assist with requirements collection, rapid payload development, reporting deliverables, training, and quick-turn RFIs.\n32. The contractor shall provide quarterly status report for all completed and in-progress actions.\n33. The contractor shall support reviews of potential foreign acquirers or investors involved in capital and capability provider applications, and those included in Committee on Foreign Investment in the United States (CFIUS) cases, as appropriate to DOD.\n34. The contractor shall integrate data output into other DoD systems in a machine-readable format (via API access).\n35. The contractor shall enable system to ingest government collected data to aid in an improved profile of the entity of concern.\n36. The contractor shall provide visualization of an entity centric model that displays an expandable view of holistic supplier, vendor, investor, and key management personnel relationships.\n37. Continuous Monitoring\n    37.1. The contractor shall provide access to continuous monitoring on all entities in which risk assessments are requested and on at least a quarterly basis.	f			R_2qE68WxTJ2ewvQu	f	43	\N	f	f	f	1	3	94	265	\N	3	\N	612	2024-07-04 14:27:25.672401+00	2024-07-12 04:28:27.492723+00	0	f	67	t	\N	\N	\N	\N	\N	\N	\N	\N	\N
