648	Onsite and Remote Language Interpreter (FL) and Foreign Language Document Translation (FLDT)	TASKS:\n1. Contractor shall furnish all materials, supplies, trained/certified personnel, supervision, transportation and otherwise do all things necessary for and incidental to providing onsite, video remote or on demand Foreign Language interpreter services. Written documents requiring translation shall be in the latest version of Microsoft Word or Adobe Acrobat PDF format.\n2. The Contractor shall provide a foreign language interpreter, foreign language document translator and video remote interpreter with required equipment and remote access, and telephonic service interpreter to the requested location within a two (2) hour notice. The Contractor shall provide a FL interpreter, FLDT, video remote interpreting service and telephonic service interpreter. The Government shall request telephonic service and video remote interpreting at the government’s discretion. The Contractor shall have the necessary videoremote interpreting (VRI) and remote access capability for all telephonic service interpreting requests. This service from the Contractor includes all transportation costs. The Contractor shallnot bill for travel or transportation under this contract.\n3. The Contractor shall perform all work promptly at the time, date, and place designated by the COR, as many competent personnel and staff and maintain such staff.\n4. The Contractor shall assign the same interpreter to an assignment lasting two hours or less. For assignments lasting two hours or more, team interpreters shall be assigned. The Contractor shall: (1) present himself or herself to the presiding official at least fifteen (15) minutes prior to the time and at the place of the designated assignment, no case, shall the interpreter arrive later than the time required to set up all required equipment and be able to begin interpreter services at the designated time; or, if the case involves the use of video remote telephonic interpreter services or telephonic interpreter services shall make telephone contact to the presiding official at least fifteen (15) minutes prior to the start time; (2) at all times shall be governed by the instructions of the presiding official in matters affecting the assignment.\n5. The Contractor shall adhere to the following: Each interpreter is fully aware of the assigned work situation, including the occasional need for extending the assignment beyond the required time; there will be unforeseen circumstances where conferences, meetings, trainings or appointments go over the expected end time (i.e., 30 minutes); and at short notice; if deemed necessary, within a two (2) hours’ notice a second interpreter shall be provided when services are known to occur over two (2) hours and will require the interpreters to be allowed a 15-minute break if requested.\n6. The Contractor shall contact the COR within one-hour from receipt of a written work order for all FLDT and FLI assignments. The COR and Contractor shall communicate on all assignment(s) as needed. The Contractor shall contact the designated COR for any business pertaining to FLI, and FLDT assignments. While performing onsite services, the contractor personnel shall be escorted by designated Government staff at all times.\n7. Punctuality: The Contractor personnel shall arrive no later than 15 minutes before the actual time of the assignment. Tardiness or missed assignments shall not be tolerated. The Contractor shall notify the COR in writing immediately if they will be tardy or miss an assignment. If the Contractor arrives 10 or more minutes late for an assignment, the COR shall determine if services are still needed. If it is determined that services are needed, the government shall take a deduction from the agreed upon rate commensurate of when the interpreter(s) arrived at the servicing site in 15-minute increments. If it is determined that service is no longer needed, this will be recorded as a missed work order and the Contractor shall not charge for service to the missed order. All tardiness and no-shows shall be documented in writing by the COR through a Contract Deficiency Report (CDR) approved by the Contracting Officer. All tardiness and no-shows will also be reflected on the Contractor’s Contractor Performance Assessment Reporting System (CPARS).\n8. The Government retains the right to not accept an interpreter for future assignments who is late or missed an assignment.\n9. On Demand Services: The Contractor shall provide on demand interpreter services through telephone or VRI, 24 hours per day, seven days per week, 365 days per year as requested by the Government. This access shall be provided immediately for medical appointments, patient care, patients and employees during all shifts. On Demand Services are an exception to the Work Order process. Work Orders for On Demand Services will be provided to the Contractor within 24 hours from the next business day after services are provided.	f				f	43	\N	f	f	f	2	112	593	\N	794	4	\N	612	2024-07-04 11:58:34.852193+00	2024-07-11 14:38:30.864455+00	0	f	67	t	\N	\N	\N	\N	\N	\N	\N	\N	\N
756	Peer Based Training and Technical Assistance (PeerTA)	Scope:\nOFA seeks a Contractor (Contractor refers to single entity or collaborative) with verifiable subject matter expertise in and experience working with TANF, workforce development, education and training, and/or human services stakeholders to develop and use promising practices to improve employment, economic stability, and/or family well-being outcomes for TANF families.  \n\nThe successful Contractor shall provide TTA on various TANF related topics to TANF programs identified and approved by OFA. The Contractor shall have experience developing user-friendly resources, tools, and products that will assist the TA requesters to achieve their goal.  Thus, the Contractor’s relevant expertise needed to accomplish these tasks must be highlighted as either internal capacity or external collaboration.\n\nThe Contractor shall provide all personnel, equipment, supplies, facilities, transportation/lodging, tools, materials, supervision, and other items and non-personal services necessary to perform the delivery of technical assistance services to TANF programs and stakeholders. For the purposes of this procurement, technical assistance may include in-person and virtual, individual and group activities for TANF programs looking to strengthen programs to improve participant outcomes. \n\nThe Contractor shall manage no more than 10 individual technical assistance activities with state, county, and tribal TANF programs. These may include one on one peer sessions, expert consultations, needs assessments, and other activities as approved by OFA. The Contractor may be requested to participate in site recruitment activities (meeting attendance, conference exhibition) in the event that OFA has not received 10 requests. The contractor is encouraged to propose specific TA activities related to TANF programming to the COR if 10 requests have not been received. \n\nEach TTA request is different, so the Contractor shall complete one or more of the following activities for each TTA request.  The Contractor shall:\n\n1.\tidentify/define the requestor’s problem;  \n2.\toutline the potential benefits of the solution(s) to the broader TANF field;\n3.\tdescribe key components and tasks of the solution(s);\n4.\toutline implementation steps, and other key topics;\n5.\tcatalog key features of an emerging/promising practice(s) and analyze its relevance to the broader TANF field; \n6.\tdevelop tailored TTA, including necessary tools and supporting documents, for recipients to plan for or implement innovative approaches; \n7.\tdevelop and manage peer-to-peer learning communities to facilitate the transfer of knowledge among peer TANF programs, where appropriate and approved; and\n8.\tdocument and develop summary reports of the TTA processes, activities, and results to inform a broader TANF field.  \n\nThe Contractor shall conduct a readiness assessment of the requester to determine its specific TTA needs, desired outcomes, and its overall capacity to participate in intensive TTA. The Contractor shall develop a menu of tools and materials to guide the provision of TTA, including, but not limited to action plans, assessments, implementation plans, logic models, or feasibility plans. All development activities will be conducted with the approval of OFA and in concert with each TTA recipient to determine the most appropriate course of action in the delivery of TTA. \nThe Contractor shall coordinate up to 2 in-person or virtual meetings (with OFA guidance and approval) for up to 50 (in-person)/100 (virtual) for varied TA sites. The Contractor shall provide for all planning and logistics costs for all meeting SMEs identified and approved by the Contractor Officer Representative (COR). Generally, meetings are hosted in Washington, DC.\nThe Contractor shall develop printed materials, including workbooks, action planning guides, logic models, asset maps, and other like materials and will be responsible for reproducing no more than 100 TTA recipient material packets for each of the onsite activities. In the event of a public health event, the Contractor shall consult with the COR regarding alternatives to printed materials. Contractor may provide less hard-copy materials if online materials are easily accessible during onsite activities.\n	f				f	43	\N	f	f	f	2	52	288	693	772	3	\N	612	2024-07-05 15:36:06.421443+00	2024-07-14 06:05:29.44923+00	0	f	67	t	\N	\N	\N	\N	\N	\N	\N	\N	\N
