616	Reasonable Accommodation (RA) Services	Scope :\nThis requirement covers both VRI and RCC/CART. A single Task Order shall be issued for both services to one vendor.\nRelay Conference Captioning (RCC), also known as Communication Access Real-Time Translation (CART)\nDeaf and hard-of-hearing individuals can participate in teleconference calls. Real-time text is streamed to the user’s internet-connected computer. RCC can caption telephone conference calls, large conferences, web conferences, or small meetings.\n\nStandard Services:\n• Reserve your live Captioner with at least 12 hours advanced notice\n• For Spanish, at least 48 hours advanced notice is required\n• Access through a web browser on any computer or mobile device with high-speed Internet\n• Background Color, Text Color and Size Options\n• Receive captioning more quickly and efficiently for multi-party communications\n• Obtain a text transcript of the conversation for your records\n\nStandard Features:\n• On-demand or prescheduled\n• Different Language platforms\n\nPBGC specifics requesting Relay Conference Captioning (RCC) Services\nRelay Conference Captioning (RCC) is real-time captioning for federal employees who are deaf or hard of hearing. It is an Internet-based technology that revolutionizes the way colleagues join and participate in teleconference calls and web conferencing. RCC uses the same high-quality Captioners that provide closed captioning for live television, news, sports and weather to deliver live, real-time text streamed to a high-speed Internet-connected computer/tablet/mobile phone anywhere in the world.\n\nVideo Relay Service (VRS) / Video Remote Interpreting (VRI)\nA deaf person signs to a video interpreter using a video camera. The video interpreter voices the conversation to a hearing person on a standard phone, and the video interpreter signs back to the deaf person on a computer or television screen. VRS also offers Video Remote Interpreting (VRI) for interpretation between individuals in the same location.\n\nStandard Services:\n• Communicate effectively and efficiently with your managers, colleagues, peers using a certified sign language interpreter\n• No need to reserve a live sign language interpreter in advance\n• Communicate from your own office space\n• All calls are confidential, and no records of conversations are ever retained\n• Available sign language interpreting in English and Spanish.\n\nStandard Features:\n• On-demand or Prescheduled times slots\n• Internet and Mobile availability	f		22117	16PBGC22Q0001	f	43	\N	f	f	f	2	84	\N	\N	794	4	6	612	2024-07-04 08:26:13.092316+00	2024-07-11 11:25:10.911281+00	0	f	73	f	\N	\N	\N	\N	\N	\N	\N	\N	\N
