860	EHSC Operator Certification Services	General Information and Contractor Qualifications:\nThe purpose of the proposed requirement is to fund tribal operator certification services from an EPA authorized vendor. The Safe Drinking Water Act requires operators of certain public drinking water systems to hold certification approved by the agency which regulates the system. Furthermore, certification is required before a tribal water system can receive infrastructure funding from the US EPA under the Drinking Water State Revolving Fund Tribal Set-Aside program.\nOperator certification is a scoring factor in the IHS Sanitation Deficiency System that impacts funding provided to tribes. Tribal operator certification promotes and enhances public health and safety by ensuring that tribal drinking water and wastewater operators have the knowledge and skills necessary to provide safe, adequate, and sustainable drinking water and sanitation services to tribal communities. The end goal is to increase the percentage of certifications held by tribal utility operators.\nThe Contractor shall be an EPA approved water certification program provider and maintain current authorization from the EPA to directly issue tribal water operator certification at levels 1-4 for distribution and treatment.\nContractor qualifications shall include:\nOperator Certification Program Management\n•EPA authorization to (1) operate a water operator certification program and/or (2) issue operator certifications\nto tribal operators\n•A minimum of 5 years’ experience in running an operator certification program\n•Established operator certifications for water operator (levels 1-4 distribution and treatment plus federal\nregulations), sewer operator (levels 1-4 collection and treatment plus federal regulations), and utility\nmanagement\n•An established database tracking certification status and applications for new certifications, renewals,\nand reciprocity\n•An established operator certification lookup website page to allow the general public to search for their\nutility operators\n•Capacity to process 700 new operator certifications annually in addition to reciprocity and renewal requests.\nThe initial contract targets 125 applications per year; however, additional work may be added to the contract\ndepending on Contractor performance and funding.\n•Ability to provide reports detailing the number of applications received per year broken out by new\napplications, reciprocity, and renewals for the past five years.\nCertification Prep Training\n•A minimum of 5 years’ experience in providing training and support to tribal utility departments or small\nrural communities. Tribal experience is preferable.\n•Trainers with a minimum of 5 years’ experience with water and/or wastewater operations. Trainers with\noperator certifications equal to or greater than the training level being taught is preferred.\n•Trainers with a minimum of 5 years’ education and experience teaching adults. Familiarity with ATLAS\nlearning styles preferred.\n•Experience working with grants and/or contracts with Federal agencies. Indian Health Service\nand/or Environmental Protection Agency experience is preferred.\n•Capability to provide demographic statistics including tribal affiliation, EPA region, and IHS Area\naffiliations of certification applicants and training course attendees.\n	f				f	43	\N	f	f	f	2	52	295	\N	849	3	\N	612	2024-07-06 13:18:20.195741+00	2024-07-17 11:13:26.819953+00	0	f	67	t	\N	\N	\N	\N	\N	\N	\N	\N	\N
